import React from "react";
import { Link } from "react-router-dom";

const Country = ({ id, flag, name, population, region, capital }) => {
  return (
    <article className="country">
      <div className="img-container">
        <img src={flag} alt={name} />
      </div>
      <div className="country-info">
        <h3>{name}</h3>
        <ul>
          <li>{population}</li>
          <li>{region}</li>
          <li>{capital}</li>
        </ul>
        <Link to={`/country/${name}`} className="btn btn-primarybtn-details">
          details
        </Link>
      </div>
    </article>
  );
};

export default Country;
